import React, { useState } from 'react';

function CountDown(){
    const [count, setCount] = useState(0);

    return (
        <>
            <p>Contador: {count}</p>
            <button onClick={() => setCount(count+1)}>
                Adicionar
            </button>
        </>
    );
}

